import logo from "./logo.svg";

import "./vendors/bootstrap/bootstrap.min.css";
import "./vendors/fontawesome/css/all.min.css";
import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import SignUp from "./screens/signup.js";
import Login from "./screens/login.js";
import Profile from "./screens/profile.js";
import MemesSearch from "./screens/meme-search.js";
import Home from "./screens/home.js";
import { ProfileProvider } from "./contexts/profile-context";
import SecureRoute from "./components/secure-route";
import MemeDetails from "./screens/meme-details";

function App() {
  return (
    <div className="container">
      <ProfileProvider>
        <BrowserRouter>
          <div className="row">
            <div className="col-2"></div>
            <div className="col-10">
              <Routes>
                <Route path="/home" element={<Home />} />
                <Route path="/signup" element={<SignUp />} />
                <Route path="/login" element={<Login />} />
                <Route
                  path="/profile"
                  element={
                    <SecureRoute>
                      <Profile />
                    </SecureRoute>
                  }
                />
                <Route path="/meme-search" element={<MemesSearch />} />
                <Route
                  path="/meme-search/:memeSearch"
                  element={<MemesSearch />}
                />
                <Route path="/details/:memeID" element={<MemeDetails />} />
              </Routes>
            </div>
          </div>
        </BrowserRouter>
      </ProfileProvider>
    </div>
  );
}

export default App;
